import React from 'react';
import Header from '../components/Header';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import history from '../history';
import { connect } from 'react-redux';

const useStyles = makeStyles((theme) => ({
    homePageContent: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    noMovementsMessage: {
        marginTop: '130px',
        fontFamily: 'PT Sans Caption',
        fontSize: '20px',
        textTransform: 'uppercase',
    },
    movementButtons: {
        fontFamily: 'PT Sans Caption',
        marginTop: '100px',
        borderRadius: '10px',
        background: '#C4C4C4',
        boxShadow: '0px 2px 2px #A9A9A9',
    },
    movementName: {
        fontFamily: 'PT Sans Caption',
        fontSize: '20px', 
        padding: '10px',
        paddingLeft: '200px',
        paddingRight: '200px',
    },
    fabDiv: {
        display: 'flex',
        justifyContent: 'flex-end',
        position: 'absolute',
        bottom: theme.spacing(2),
        right: theme.spacing(2),
      },
    fab: {
        background: '#C4C4C4',
    },
}));

const HomePage = (props) => {
    const classes = useStyles();
    const name  = props.name?.newMovement?.movementName;
    //props.name?.newMovement?.movementName;
    console.log(props.name);
    const newMoves = props.name.children.movementName && props.name.children.movementName.map((lift) => 
        <Button 
            key={lift.id}
            className={classes.movementName}
            onClick={() => history.push(`/movement/${lift.id}`)}>
            {lift}
        </Button>
    );
    console.log(newMoves, "new");

    const displayMovementButtons = () => {
        if (!name) {    
            return (
                <div className={classes.noMovementsMessage} >Click add button to begin</div> 
            )
        };

        return (
            <div>{newMoves}</div>
        )
    };

    return (
        <div className={classes.homePageContent} >
            <Header title={"Home Page" }/>
            <div>{displayMovementButtons()}</div>
            <div className={classes.fabDiv}>
                <Fab 
                    className={classes.fab}
                    onClick={() => history.push(`/add`)}>  
                    <AddIcon />      
                </Fab>
            </div>
        </div>
    );
};

const mapStateToProps = (state) => {
    return {
        name: state.move
    }
};

export default connect(mapStateToProps)(HomePage);
